    false,nt"url": null,nt"notes": "USGS - Suwannee River Water Management
    District Contract No.G10PC00093, Task Order No.G12PD00242 Prime Contractor: Digital
    Aerial Solutions (DAS) Sub-Contractor: Gustin, Cothern & Tucker, Inc. (GCT) The
    Vertical Accuracy Requirements are required to meet or exceed an RMSEz of 9.25 centimeters
    and a Fundamental Vertical Accuracy requirement of 18.2 centimeters at the 95% Confidence
    Level according to the NDEP guidelines. Digital Aerial Solutions, LLC (DAS) was
    tasked to collect and process a Light Detection And Ranging (LiDAR) derived elevation
    dataset for the Suwannee Management, FL. The Suwannee Management survey area encompasses
    approximately 725 square miles. Aerial LiDAR data was collected utilizing an ALS60.
    The ALS60 is a discrete return topographic LiDAR mapping system manufactured by
    Leica Geosystems. LiDAR data collected for the Suwannee Management survey has a
    nominal pulse spacing of 0.9 meters, and includes up to 4 discrete returns per pulse,
    along with intensity values for each return.",nt"license_title": null,nt"extras":
